{'pk': 18072745507102254, 'user_id': 5434444079, 'text': 'üëâüèª¬øC√≥mo se puede explicar la fascinaci√≥n que muchos sintieron con el macrismo? ¬øCu√°ndo te diste cuenta de que eras peronista? ¬øTe agarraste a pi√±as por pol√≠tica? ¬øHay que mantener la relaci√≥n con el Fondo Monetario? ¬øCu√°nto de la pol√≠tica econ√≥mica de Macri fue planeado y cu√°nto fue un error? ¬øC√≥mo se aborda la cuesti√≥n de la corrupci√≥n? ¬øNo hizo mal el kirchnerismo en pelearse con el campo? ¬øQu√© nivel de reforma pol√≠tica requieren tus ideas econ√≥micas? ¬øA qui√©n le sirve la grieta? ¬øQu√© hay que hacer para que la Argentina sea alguna vez un ‚Äúpa√≠s normal‚Äù? ¬øSos feminista?

Lejos del an√°lisis puramente econ√≥mico en el que muchas veces se lo quiere encasillar, en este libro Axel Kicillof se presta, c√≥modo y reflexivo, al juego de exponer y argumentar sus ideas pol√≠ticas y a mirar el pa√≠s de manera cr√≠tica pero tambi√©n propositiva. Lo hace en di√°logo con destacados y destacadas periodistas, interlocutores incisivos y nada complacientes, y el resultado son conversaciones apasionantes y reveladoras.

